import { Form, Hero, Tip } from "../comps/Portal";

const Methods = () => {
  return (
    <>
      <Hero
        title="گویا زمان همکاریمون فرا رسیده!"
        subtitle="تنها باید فرم زیر رو پر کنی تا با امپراتوری تماس بگیری"
      />
    </>
  );
};

export default Methods;
